        <div>
            <h6>Entry:100</h6>
            <badge>Live</badge>
        </div>
    )
    
    const CardBody = (
        <div>
            <div>
                <h6>English Grammer</h6>
                <h5>Play and Win 200,000</h5>
                <p>Winner announcement: 03:30 PM</p>
            </div>
        </div>
    )
    

    return(
        <Card>
            <h1>hello</h1>
            
        </Card>
    )
}
export default QuizCard;
